import React, { Component } from 'react';
import { NavLink } from 'react-router-dom';
import { Navbar, Nav, Button, Image } from 'react-bootstrap';


class HeaderNavbar extends Component {


    render() {
        const { openLoginModal } = this.props;

        return(
            <div>
                <Navbar bg="dark" variant="dark" sticky="top">
                    <Image className='nav-icon' src='/images/direction.png' rounded style={{height: 50}}/>
                    <Navbar.Brand>Strider Store</Navbar.Brand>
                    <Navbar.Collapse>
                        <Nav justify>
                            <NavLink to='/home' className='nav-link'>Home</NavLink>
                            <NavLink to='/purchase' className='nav-link'>Purchase</NavLink>
                            <NavLink to='/receipts' className='nav-link'>Receipts</NavLink>
                            <NavLink to='/analytics' className='nav-link'>Analytics</NavLink>
                        </Nav>
                        <Nav className="ml-auto">
                            <Button variant="outline-info" onClick={openLoginModal}>Login</Button>
                        </Nav>
                    </Navbar.Collapse>
                </Navbar>
                <div>Icons made by <a href="http://www.dariusdan.com" title="Darius Dan">Darius Dan</a> from <a href="https://www.flaticon.com/" title="Flaticon">www.flaticon.com</a></div>
            </div>
        )
    }
}

export default HeaderNavbar;
